import Link from "next/Link";
import {withRouter} from "next";

 function Kris(obj) {
    console.log(obj);
    return (
        <div>
            <div>吴亦凡</div>
           <Link href="/"><a>首页</a></Link>
        </div>
    )
}

export default withRouter(Kris);
